import {useParams} from 'react-router-dom'



export const hausDetailedLoader = async ({params})=>{
  const {id} = params;

  const res = await fetch('http://localhost:4000/hauses/'+id)

  return res.json()
}

export default function HausDetailed() {

  const {id} = useParams()




  return (
    <div>{id}</div>
  )
}
